CREATE TABLE TB_REGIAO (
    COD_SEQ_REGIAO INTEGER NOT NULL UNIQUE AUTO_INCREMENT,
    NO_REGIAO VARCHAR(20) UNIQUE NULL,
    NU_POPULACAO VARCHAR(60) NULL,
    NU_ESTADOS INTEGER NULL,
    NU_DESIDADE_DEMOGRAFICA VARCHAR(50) NULL,
    PIB VARCHAR(40),
    TAM_TERRITORIO VARCHAR(40) NULL,
    PRIMARY KEY (COD_SEQ_REGIAO)
);


CREATE TABLE TB_ESTADO (
    COD_SEQ_ESTADO INTEGER NOT NULL UNIQUE AUTO_INCREMENT,
    SG_UF VARCHAR(2) NOT NULL UNIQUE,
    NO_ESTADO VARCHAR(40) NULL,
    NU_POPULACAO VARCHAR(60) NULL,
    NU_MUNICIPIOS INTEGER NULL,
    PIB VARCHAR(40),
    NU_DESIDADE_DEMOGRAFICA VARCHAR(50) NULL,
    TAM_TERRITORIO VARCHAR(40) NULL,
    COD_REGIAO INTEGER NULL,
    PRIMARY KEY (COD_SEQ_ESTADO)
);

CREATE TABLE TB_MUNICIPIO (
    COD_SEQ_MUNICIPIOS INTEGER NOT NULL UNIQUE AUTO_INCREMENT,
    SG_UF VARCHAR(2) NULL,
    NO_MUNICIPIO VARCHAR(70) NULL,
    TAM_TERRITORIO VARCHAR(40) NULL,
    COD_ESTADO INTEGER NOT NULL,
    PRIMARY KEY (COD_SEQ_MUNICIPIOS)
);



